class Solution:
    def minSum(self, nums1: List[int], nums2: List[int]) -> int:
        sum1 = sum(nums1)
        sum2 = sum(nums2)
        zeros1 = nums1.count(0)
        zeros2 = nums2.count(0)

        if zeros1 == 0 and zeros2 == 0:
            return sum1 if sum1 == sum2 else -1

        if sum1 > sum2:
            required_sum = sum1 + zeros2 - sum2
            if required_sum % zeros1 == 0:
                return sum1 + max(zeros2, required_sum // zeros1)
            else:
                return -1
        elif sum2 > sum1:
            required_sum = sum2 + zeros1 - sum1
            if required_sum % zeros2 == 0:
                return sum2 + max(zeros1, required_sum // zeros2)
            else:
                return -1
        else:
            return sum1 + max(zeros1, zeros2)
